import React, { Component } from 'react'

export default class TripTable extends Component {
    render() {
        let tripArr = this.props.arr
        return (
            <div>
                <ul>
                {
                    tripArr.map(el => {
                    return <li>{`name ${el.name}, id ${el.id}`}</li>
                    })
                }
                </ul>

            </div>
        )
    }
}
